backend.tf.code:
terraform {
  backend "s3" {
    bucket     = "cloud-ai-demo-infra"
    key        = "cloud-ai/cicd-agent.tfstate"
    region     = "us-east-1"
    encrypt    = true
    # Optionally enable DynamoDB for state locking
    # dynamodb_table = "my-lock-table"
  }
}

./module/vpc/main.tf.code:
resource "aws_vpc" "main" {
  cidr_block           = var.vpc_cidr
  enable_dns_support   = true
  enable_dns_hostnames = true

  tags = {
    "Name" = "CloudAI-VPC"
  }
}

resource "aws_subnet" "public" {
  count                   = length(var.availability_zones)
  vpc_id                  = aws_vpc.main.id
  cidr_block              = cidrsubnet(var.vpc_cidr, 8, count.index)
  availability_zone       = var.availability_zones[count.index]
  map_public_ip_on_launch = true

  tags = {
    "Name" = "PublicSubnet-${count.index}"
  }
}

# Create an internet gateway for the VPC
resource "aws_internet_gateway" "gw" {
  vpc_id = aws_vpc.main.id

  tags = {
    "Name" = "CloudAI-InternetGateway"
  }
}

# Route table and association for public subnets
resource "aws_route_table" "public" {
  vpc_id = aws_vpc.main.id

  route {
    cidr_block = "0.0.0.0/0"
    gateway_id = aws_internet_gateway.gw.id
  }

  tags = {
    "Name" = "PublicRouteTable"
  }
}

resource "aws_route_table_association" "public" {
  count          = length(var.availability_zones)
  subnet_id      = aws_subnet.public[count.index].id
  route_table_id = aws_route_table.public.id
}

./module/vpc/variables.tf.code:
variable "vpc_cidr" {
  description = "The CIDR block for the VPC"
  default     = "10.0.0.0/16"
}

variable "availability_zones" {
  description = "List of availability zones in which to create subnets"
  type        = list(string)
  default     = ["us-east-1a", "us-east-1b", "us-east-1c"]
}

./module/vpc/outputs.tf.code:
output "vpc_id" {
  description = "The ID of the VPC"
  value       = aws_vpc.main.id
}

output "public_subnets" {
  description = "List of IDs of public subnets"
  value       = aws_subnet.public.*.id
}

output "internet_gateway_id" {
  description = "The ID of the Internet Gateway"
  value       = aws_internet_gateway.gw.id
}

./module/ec2/main.tf.code:
resource "aws_security_group" "alb" {
  name        = "alb-security-group"
  description = "Security group for ALB"
  vpc_id      = var.vpc_id
}

resource "aws_launch_configuration" "asg_config" {
  name_prefix   = "asg-config-"
  image_id      = var.ami_id
  instance_type = var.instance_type
  user_data     = data.template_file.user_data.rendered

  security_groups = [aws_security_group.alb.id]

  lifecycle {
    create_before_destroy = true
  }
}

resource "aws_autoscaling_group" "asg" {
  name_prefix             = "asg-"
  launch_configuration    = aws_launch_configuration.asg_config.id
  min_size                = var.min_size
  max_size                = var.max_size
  desired_capacity        = var.desired_capacity
  vpc_zone_identifier     = var.subnets
  health_check_type       = "ELB"
  wait_for_elb_capacity   = var.min_size

  tag {
    key                 = "Name"
    value               = "CloudAI-ASG-Instance"
    propagate_at_launch = true
  }

  lifecycle {
    create_before_destroy = true
  }
}

resource "aws_alb" "application_load_balancer" {
  name               = "alb-cloudai"
  subnets            = var.subnets
  security_groups    = [aws_security_group.alb.id]

  # Specify the type here if needed, defaults to "application"
  # type = "application"

  enable_deletion_protection = false

  tags = {
    Name = "CloudAI-ALB"
  }
}

data "template_file" "user_data" {
  template = <<-EOF
              #!/bin/bash
              echo "Auto Deployment from Cloud-AI" > index.html
              nohup busybox httpd -f -p ${var.server_port} &
              EOF
}

resource "aws_alb_target_group" "alb_target_group" {
  name     = "alb-target-group"
  port     = var.server_port
  protocol = "HTTP"
  vpc_id   = var.vpc_id
}

resource "aws_alb_listener" "alb_listener" {
  load_balancer_arn = aws_alb.application_load_balancer.arn
  port              = "80"
  protocol          = "HTTP"

  default_action {
    type             = "forward"
    target_group_arn = aws_alb_target_group.alb_target_group.arn
  }
}

resource "aws_autoscaling_attachment" "asg_attachment" {
  autoscaling_group_name   = aws_autoscaling_group.asg.id
  alb_target_group_arn     = aws_alb_target_group.alb_target_group.arn
}

./module/ec2/variables.tf.code:
variable "vpc_id" {
  description = "The ID of the VPC"
  type        = string
}

variable "subnets" {
  description = "List of subnet IDs to associate with the autoscaling group"
  type        = list(string)
}

variable "ami_id" {
  description = "The AMI ID for the EC2 instances"
  default     = "ami-0b0ea68c435eb488d"
}

variable "instance_type" {
  description = "The instance type of the EC2 instance"
  default     = "t2.micro"
}

variable "min_size" {
  description = "The minimum size of the autoscale group"
  default     = 1
}

variable "max_size" {
  description = "The maximum size of the autoscale group"
  default     = 3
}

variable "desired_capacity" {
  description = "The desired number of instances in the autoscale group"
  default     = 1
}

variable "server_port" {
  description = "The port on which the server will run"
  default     = "8080"
}

./module/ec2/outputs.tf.code:
output "alb_dns_name" {
  description = "DNS name of the application load balancer"
  value       = aws_alb.application_load_balancer.dns_name
}

output "asg_name" {
  description = "The autoscaling group name"
  value       = aws_autoscaling_group.asg.name
}

./main.tf.code:
provider "aws" {
  region = "us-east-1"
}

module "vpc" {
  source             = "./module/vpc"
  vpc_cidr           = var.vpc_cidr
  availability_zones = var.availability_zones
}

module "ec2" {
  source          = "./module/ec2"
  vpc_id          = module.vpc.vpc_id
  subnets         = module.vpc.public_subnets
  ami_id          = var.ami_id
  instance_type   = var.instance_type
  min_size        = var.asg_min_size
  max_size        = var.asg_max_size
  desired_capacity = var.asg_desired_capacity
  server_port     = var.server_port
}

